;(12) Формат представления - Видеозаписи (позиция символа 16)
a = Beta (видеокассета 2х-катушечная). Формат для бытовой видеозаписи, представленный в 1975 г. фирмой Sony
b = VHS (видеокассета 2х-катушечная). Формат для бытовой видеозаписи, разработанный фирмой JVC (Япония) и выпущенный на рынок в 1977 г.
c = U-matic (видеокассета 2х-катушечная): Видеоформат, использующий торговую марку фирмы Sony, соответствует ленточной дорожке в форме U. Известен также как "стандарт типа U"
d = EIAJ (катушка). Стандарт 111 дюймового непрерывного геликоидального формата сканирования видеопленки. Назван по имени Японского комитета стандартизации, который устанавливает стандарты для 1/2 дюймовых видеомагнитофонов, производимых с 1969 г.
е = Тип С (катушка). Видеоформат, использующий одну записывающую головку со скоростью движения ленты 9.61 дюйма в сек., используемый для телевизионного вещания во многих странах. Оборудование и технология типа С производится фирмами Sony, RCA и др.
f = Катушечный учетверенный (рулон). Видеосистема, использующая четыре записывающих головки, разработана фирмой Атрех в 1950 г.
g = Лазерный оптический (отражающий) видеодиск. Без бороздок, гладкий, круглый пластиковый диск с зеркальной поверхностью, обычно 12" в диаметре, на обеих сторонах которого содержится видеоинформация. Информация с диска считывается при помощи слабого лазерного луча. Система стала широкодоступной в 1978 г. и в настоящее время используется в бытовых и промышленных условиях.
h = CED (емкостный электронный диск) видеодиск. Пластиковый диск с бороздками, обычно 12" в диаметре, содержащий информацию, записанную как последовательность углублений на дне бороздок и воспроизводимую с помощью электронных перьев. В 1984 г. фирма RCA, производитель видеопроигрователей CED, объявила решение о прекращении выпуска этой продукции.
i = V2000 (видеокассета 2х-катушечная). Формат для бытовой видеозаписи, разработанный в Европе фирмой Philips, и который производится с 1980 г. Реверсивный.
j = Video 8 (видеокассета 2х-катушечная). Формат для бытовой видеозаписи.
u = неизвестно
